script: |
  super -f text -I q9954.spq | sort > q9954.out

inputs:
  - name: q9954.spq
    data: |
      SELECT DISTINCT col2 - - - 0 AS col2 FROM tab2 (FORMAT parquet) WHERE NOT - + col0 / 58 * - col2 + - col1 + + - 66 = - - col0 / + CAST ( NULL AS INTEGER );
  - name: tab2

outputs:
  - name: q9954.out
    data: |
